import React from 'react';

function ContactIcons() {
  return (
    <div className="contact-icons">
        <a href="tel:614-315-6951"><i className="fas fa-mobile"></i><span>Phone</span></a>
        <a href="mailto:katensullivan55@gmail.com"><i className="fas fa-at"></i><span>Email</span></a>
        <a href="https://github.com/katensullivan55" target="_blank" rel="noreferrer"><i className="fab fa-github"></i><span>Github</span></a>
        <a href="https://www.linkedin.com/in/kate-sullivan-37ab12225/" target="_blank" rel="noreferrer"><i className="fab fa-linkedin-in"></i><span>LinkedIn</span></a>
      </div>
  )
}

export default ContactIcons;
